// Frontend code 
// Filename - App.js
// Filename - App.js

import React from 'react';
import Regi from './Regi';
import Login from './LoginS'
import { BrowserRouter } from 'react-router-dom';


function App() {

	return (
		<BrowserRouter>
			<Routes>
        	<Route path="/" element={<Regi />}/>
        	<Route path="/login" element={<Login />}/>
			</Routes>
		</BrowserRouter>

	);
}

export default App;
